import React, { useState, useEffect } from 'react';
import styled, { keyframes } from 'styled-components';

// 动画效果
const float = keyframes`
  0% { transform: translateY(0px); }
  50% { transform: translateY(-20px); }
  100% { transform: translateY(0px); }
`;

const glow = keyframes`
  0% { box-shadow: 0 0 5px #4ECDC4, 0 0 10px #4ECDC4; }
  100% { box-shadow: 0 0 10px #4ECDC4, 0 0 20px #4ECDC4; }
`;

const ExploreContainer = styled.div`
  min-height: 100vh;
  background: #1a1a1a;
  color: #fff;
  padding: 2rem;
  position: relative;
  overflow: hidden;
`;

const Header = styled.div`
  text-align: center;
  margin-bottom: 3rem;
  position: relative;
  z-index: 2;
`;

const Title = styled.h1`
  font-size: 3rem;
  color: #4ECDC4;
  margin-bottom: 1rem;
  animation: ${glow} 2s ease-in-out infinite alternate;

  @media (max-width: 768px) {
    font-size: 2rem;
  }
`;

const SearchBar = styled.div`
  max-width: 600px;
  margin: 0 auto;
  position: relative;

  input {
    width: 100%;
    padding: 1rem 2rem;
    border-radius: 50px;
    border: 2px solid #4ECDC4;
    background: rgba(78, 205, 196, 0.1);
    color: #fff;
    font-size: 1.1rem;

    &:focus {
      outline: none;
      box-shadow: 0 0 15px rgba(78, 205, 196, 0.3);
    }
  }
`;

const FilterSection = styled.div`
  display: flex;
  justify-content: center;
  gap: 1rem;
  margin: 2rem 0;
  flex-wrap: wrap;
`;

const FilterTag = styled.button`
  padding: 0.5rem 1.5rem;
  border-radius: 20px;
  border: 1px solid #4ECDC4;
  background: ${props => props.active ? '#4ECDC4' : 'transparent'};
  color: ${props => props.active ? '#1a1a1a' : '#4ECDC4'};
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 5px 15px rgba(78, 205, 196, 0.2);
  }
`;

const ItemGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(280px, 1fr));
  gap: 2rem;
  padding: 2rem 0;
`;

const ItemCard = styled.div`
  background: rgba(30, 30, 30, 0.8);
  border-radius: 15px;
  overflow: hidden;
  transition: all 0.3s ease;
  animation: ${float} 6s ease-in-out infinite;
  animation-delay: ${props => props.delay}s;

  &:hover {
    transform: translateY(-10px);
    box-shadow: 0 10px 20px rgba(78, 205, 196, 0.2);
  }
`;

const ItemImage = styled.img`
  width: 100%;
  height: 200px;
  object-fit: cover;
`;

const ItemInfo = styled.div`
  padding: 1.5rem;
`;

const ItemTitle = styled.h3`
  font-size: 1.2rem;
  color: #4ECDC4;
  margin-bottom: 0.5rem;
`;

const ItemDescription = styled.p`
  color: rgba(255, 255, 255, 0.8);
  font-size: 0.9rem;
  margin-bottom: 1rem;
`;

const ItemFooter = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  color: rgba(255, 255, 255, 0.6);
`;

function Explore() {
  const [activeFilter, setActiveFilter] = useState('全部');
  const [items, setItems] = useState([]);

  // 模拟数据
  useEffect(() => {
    const mockItems = [
      {
        id: 1,
        title: '复古留声机',
        description: '一台来自80年代的索尼留声机，音质依然完美...',
        image: 'https://images.unsplash.com/photo-1461360228754-6e81c478b882',
        location: '东城区',
        price: '¥2999'
      },
      {
        id: 2,
        title: '手工木雕摆件',
        description: '老匠人精心雕刻的木质摆件，充满东方韵味...',
        image: 'https://images.unsplash.com/photo-1513519245088-0e12902e5a38',
        location: '西城区',
        price: '¥599'
      },
      // 可以添加更多模拟数据...
    ];

    setItems(mockItems);
  }, []);

  const filters = ['全部', '古董', '手工艺', '收藏品', '稀有物件'];

  return (
    <ExploreContainer>
      <Header>
        <Title>探索奇物</Title>
        <SearchBar>
          <input type="text" placeholder="搜索你感兴趣的物品..." />
        </SearchBar>
        <FilterSection>
          {filters.map(filter => (
            <FilterTag 
              key={filter}
              active={activeFilter === filter}
              onClick={() => setActiveFilter(filter)}
            >
              {filter}
            </FilterTag>
          ))}
        </FilterSection>
      </Header>

      <ItemGrid>
        {items.map((item, index) => (
          <ItemCard key={item.id} delay={index * 0.2}>
            <ItemImage src={item.image} alt={item.title} />
            <ItemInfo>
              <ItemTitle>{item.title}</ItemTitle>
              <ItemDescription>{item.description}</ItemDescription>
              <ItemFooter>
                <span>📍 {item.location}</span>
                <span>{item.price}</span>
              </ItemFooter>
            </ItemInfo>
          </ItemCard>
        ))}
      </ItemGrid>
    </ExploreContainer>
  );
}

export default Explore;
